import React from "react";
import axios from "axios";
import { Button, Form, Input, Card } from "antd";
import { useNavigate } from "react-router-dom";
import { decodeToken } from "react-jwt";
import Swal from "sweetalert2";

const Login = () => {
  const navigate = useNavigate();

  // Handle successful form submission
  const onFinish = async (values) => {
    try {
      // Send login request to the API
      const { data } = await axios.post(
        "https://localhost:5235/api/Users/Login",
        {
          username: values.username,
          password: values.password,
        }
      );

      // Decode the JWT token to retrieve user details
      const myDecodedToken = decodeToken(data.token);

      if (!myDecodedToken) {
        throw new Error("Invalid token received");
      }

      console.log("Decoded Token: ", myDecodedToken);

      // Check if the token has an expiration date and roles
      const expiration = myDecodedToken.exp;
      const currentTime = Math.floor(Date.now() / 1000);
      const timeLeft = expiration - currentTime;

      if (timeLeft <= 0) {
        Swal.fire({
          icon: "error",
          title: "Session Expired",
          text: "Please log in again.",
          color: "red",
          width: 400,
        });
        return;
      }

      // Store user role and account details in local storage
      const userRole = myDecodedToken[
        "http://schemas.microsoft.com/ws/2008/06/identity/claims/role"
      ];

      if (userRole) {
        localStorage.setItem("role", userRole);
      } else {
        console.warn("Role not found in the token.");
      }

      localStorage.setItem("account", JSON.stringify(data));

      // Navigate to the home page after storing the token
      navigate("/");
      window.location.reload();
    } catch (e) {
      // Log the error
      console.error("Login Error: ", e);

      // Show a detailed error message based on the server's response
      const errorMessage =
        e.response?.data?.message || "Please check your username or password";
      Swal.fire({
        icon: "error",
        title: "Login Failed",
        text: errorMessage,
        color: "red",
        width: 400,
      });
    }
  };

  // Handle failed form submission (validation issues)
  const onFinishFailed = (errorInfo) => {
    console.error("Failed:", errorInfo);
  };

  return (
    <div style={styles.container}>
      <Card style={styles.card}>
        <h1 style={styles.title}>Login</h1>

        <Form
          name="loginForm"
          onFinish={onFinish}
          onFinishFailed={onFinishFailed}
          autoComplete="off"
          layout="vertical"
          style={styles.form}
        >
          <Form.Item
            label="Username"
            name="username"
            rules={[{ required: true, message: "Please input your username!" }]}
          >
            <Input placeholder="Enter your username" />
          </Form.Item>

          <Form.Item
            label="Password"
            name="password"
            rules={[{ required: true, message: "Please input your password!" }]}
          >
            <Input.Password placeholder="Enter your password" />
          </Form.Item>

          <Form.Item style={{ textAlign: "center" }}>
            <Button type="primary" htmlType="submit" style={styles.submitButton}>
              Submit
            </Button>
          </Form.Item>

          {/* Add a link to navigate to the registration page */}
          <Form.Item style={{ textAlign: "center" }}>
            <span>Don't have an account? </span>
            <Button type="link" onClick={() => navigate("/register")}>
              Create Account
            </Button>
          </Form.Item>
        </Form>
      </Card>
    </div>
  );
};

// Styling for the component
const styles = {
  container: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    height: "100vh",
    justifyContent: "center",
    background:
      "radial-gradient(circle, rgba(163,163,163,1) 100%, rgba(230,230,230,1) 100%, rgba(168,191,197,1) 100%, rgba(32,25,56,1) 100%, rgba(0,255,239,1) 100%)",
  },
  card: {
    width: "30%",
    justifyContent: "center",
    alignItems: "center",
    padding: "20px",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    borderRadius: "8px",
  },
  title: {
    textAlign: "center",
    marginBottom: "30px",
    fontWeight: "bold",
    fontSize: "24px",
  },
  form: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
  },
  submitButton: {
    width: "100px",
  },
};

export default Login;
